    [],nt"revision_timestamp": "2016-05-27T02:32:34.894010",nt"name": "coastal-barrier-resources-system-cbrs-boundaries",nt"isopen":
    false,nt"url": null,nt"notes": "This table is only required from Mapping
    Partners producing Preliminary and Final Digital Flood Insurance Rate Map (DFIRM)
    databases. This table only applies to coastal areas that have specially protected
    areas designated by Congress on John H. Chafee Coastal Barrier Resources System
    (CBRS) maps. Authoritative CBRS boundary locations are shown on these maps administered
    by the U.S. Fish and Wildlife Service. Normally these areas are already shown on
    existing Federal Emergency Management Agency (FEMA) Flood Insurance Rate Maps (FIRMs)
    for the area. CBRS areas have restrictions Federal funding (including flood insurance
    coverage) after specified dates for new or substantially improved structures. See
    Section 2.2 and Appendix K of these Guidelines for more detailed information about
    CBRS areas. The S_CBRS table contains information about the CBRS areas within the
    study area, if applicable. A spatial file with locational information also corresponds
    with this data table. The spatial elements representing CBRS features are closed
    polygons. Each contiguous CBRS area of the same CBRS_TYP and same CBRS_DATE should
    be a single polygon. This is a Standard DFIRM Database table. More information can
    be found in the document 'Guidelines and Specifications for Flood Hazard Mapping
    Partners Appendix LGuidance for Preparing Draft Digital Data and DFIRM Database'
    located on this disk.",nt"license_title": "License Not Specified",nt"extras":
